function update(event) {
  time = (event['time']) * 0.1;
  this.position.x = (Math.sin(time / 180 * Math.PI) * 4)
  this.position.z = (Math.cos(time / 180 * Math.PI) * 4)
  this.lookAt(scene.position)
}


player.setCamera(this)
